import React, { Component } from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.css";
import { Route } from "react-router-dom";
import Navbar from "./components/Navbar/navBar";
import Testcases from "./components/testcases/testcases.jsx";
import Footer from "./components/footer";
import CodingPage from "./components/Coding Page/codingPage";
import LoginPage from "./components/Login Page/loginPage";

class Coding extends Component {
  state = {};
  render() {
    return (
      <div className="container-fluid">
        <div className="row" style={{ height: "93vh" }}>
          <Route path="/login" component={LoginPage} />
          <Navbar />
          <div className="col-sm-10">
            <div className="row" style={{ height: "86vh" }}>
              <Route path="/testcases" component={Testcases}></Route>
              <Route path="/coding" component={CodingPage} />
            </div>
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}

export default Coding;
